import React from 'react';

import classes from './Feira.module.css';

const feira = ( props ) => {

    const ingredients = [];



    return (
        <div className={classes.Feira}>
            <p>Nome: {props.nome}</p>
            <p>Local: {props.local}</p>
        </div>
    );
};

export default feira;
